{"query":"query getAccountCurrentTokens($address: String!, $offset: Int, $limit: Int) {
  current_token_ownerships(
    where: {owner_address: {_eq: $address}, amount: {_gt: 0}}
    order_by: [{last_transaction_version: desc}, {creator_address: desc}, {collection_name: desc}, {name: desc}]
    offset: $offset
    limit: $limit
  ) {
    amount
    current_token_data {
      ...TokenDataFields
    }
    current_collection_data {
      ...CollectionDataFields
    }
    last_transaction_version
    property_version
    token_properties
  }
}

fragment TokenDataFields on current_token_datas {
  creator_address
  collection_name
  description
  metadata_uri
  name
  token_data_id_hash
  collection_data_id_hash
}

fragment CollectionDataFields on current_collection_datas {
  metadata_uri
  supply
  description
  collection_name
  collection_data_id_hash
  table_handle
  creator_address
}","variables":{"address":"0xd95eae20cc6de43cfa51cb761435515a008446877ccbdfe91a9d853f2b6421e0","limit":12,"offset":0},"operationName":"getAccountCurrentTokens"}

{"query":"query getTokenPendingClaims($address: String!, $offset: Int, $limit: Int) {
  current_token_pending_claims(
    where: {_or: [{from_address: {_eq: $address}, amount: {_gt: "0"}}, {to_address: {_eq: $address}, amount: {_gt: "0"}}]}
    order_by: [{last_transaction_timestamp: desc}, {last_transaction_version: desc}]
    offset: $offset
    limit: $limit
  ) {
    ...CurrentTokenPendingClaims
  }
}

fragment CurrentTokenPendingClaims on current_token_pending_claims {
  amount
  from_address
  to_address
  last_transaction_version
  last_transaction_timestamp
  property_version
  current_token_data {
    ...TokenDataFields
  }
  current_collection_data {
    ...CollectionDataFields
  }
  token {
    ...TokensDataFields
  }
}

fragment TokenDataFields on current_token_datas {
  creator_address
